import React from "react";

function HelloDiv() {
  return <div>
  <h1>Hello! My name is Steven</h1>
    <ul>
    <li>I like sports</li>
    <li>I like my dog</li>
    <li>I like food</li>
  </ul>
  </div>
}

export default HelloDiv;
